import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import reportWebVitals from './reportWebVitals';
import './scss/main.scss';
import Navigation from "./Components/Navigation";
import Header from "./Components/Header";

import TinySlider from "tiny-slider-react";


const styles = {
    fontFamily: "sans-serif",
    textAlign: "center"
};

const imgStyles = {
    width: "100%",
    height: "320px",
    objectFit: "cover"
};

const imgs = [
    "http://d2ji2mue1p384z.cloudfront.net/img/480x360/162951.jpg",
    "http://d2ji2mue1p384z.cloudfront.net/img/480x360/162465.jpg",
    "http://d2ji2mue1p384z.cloudfront.net/img/480x360/220048.jpg"
];

const loadingImage =
    "data:image/gif;base64,\
    R0lGODlhAQABAPAAAMzMzAAAACH5BAAAAAAALAAAAAABAAEAAAICRAEAOw==";

const settings = {
    lazyload: true,
    nav: true,
    mouseDrag: true,
    loop: true,
    items: 1,
    autoplay: true,
    autoplayTimeout: 2000,
    gutter: 5
};

const clickEvent = (slide, info) => {
    console.log(slide, info);
};
const App = () => (
    <div style={styles}>
        <TinySlider settings={settings} onClick={clickEvent}>
            {imgs.map((el, index) => (
                <div key={index} style={{ position: "relative" }}>
                    <div>
                        <img
                            className={`tns-lazy-img`}
                            src={loadingImage}
                            data-src={el}
                            alt=""
                            style={imgStyles}
                        />
                    </div>
                </div>
            ))}
        </TinySlider>
        <br />
        <br />
        <br />
        <TinySlider settings={settings} onClick={clickEvent}>
            {imgs.map((el, index) => (
                <div key={index} style={{ position: "relative" }}>
                    <img
                        className={`tns-lazy-img`}
                        src={loadingImage}
                        data-src={el}
                        alt=""
                        style={imgStyles}
                    />
                </div>
            ))}
        </TinySlider>
    </div>
);


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <Header/>
        <Navigation/>
        <App/>



    </React.StrictMode>
);

reportWebVitals();
